import React from 'react';
import classes from './About.module.css';

export default function About() {
    return (
        <div>
            <div className={classes.Card}>Mein Foto</div>
            <div>Danke für Besuch der App</div>
            <div>Über mich und dev</div>
            <div>Mein Lieblingszitat</div>
            <div>Über diese App</div>
            <div>Kontakt (Xing, E-Mail o.ä.)</div>
        </div>
    )
};
